Getting the data from the referenced object in Moongoose<p>i have created two models i.e., User and todos. In todos schema i am referencing to user through</p>
<pre><code>user: {
    id: {
      type: mongoose.Schema.Types.ObjectId,
      ref: &quot;User&quot;,
    },
</code></pre>
<p>Now in the database, the object is created in the todo as user &gt; id,I can display the id in ejs using details.user.id but i want to access the other properties of this user, like his name and email. Please help me</p>
<p>user schema:</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);

const UserSchema = new mongoose.Schema({
  name: {
    type: String,
    required: true,
    unique: true,
  },
  email: {
    type: String,
    required: true,
  },
  password: {
    type: String,
    required: true,
  },
  date: {
    type: Date,
    default: Date.now,
  },
  admin: Boolean,
});

const User = mongoose.model(&quot;User&quot;, UserSchema);

module.exports = User;
</code></pre>
<p>todo schema:</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const todoTaskSchema = new mongoose.Schema({
  content: {
    type: String,
    required: true,
  },
  date: {
    type: Date,
    default: Date.now,
  },
  user: {
    id: {
      type: mongoose.Schema.Types.ObjectId,
      ref: &quot;User&quot;,
    },
    user: String,
  },
});
module.exports = mongoose.model(&quot;TodoTask&quot;, todoTaskSchema);
</code></pre>
<p><a href="https://i.stack.imgur.com/LGnNV.png" rel="nofollow noreferrer">Document in Mongoose</a></p>

